}

}

}

}

slides {

height: 100%;

top: 0;

-o-transform: rotateZ(180deg);
transform: rotateZ(180deg);
}

aside.gdbar.right img {
-webkit-transform: rotateZ(180deg);
-moz-transform: rotateZ(180deg);
-ms-transform: rotateZ(180deg);
-o-transform: rotateZ(180deg);
transform: rotateZ(180deg);
}

aside.gdbar.bottom {
top: -moz-initial;
top: initial;
bottom: 60px;
}

aside.gdbar img {
width: 85px;
height: 85px;
position: absolute;
right: 0;
margin: 8px 15px;
}

.title-slide hgroup {
bottom: 100px;
}

.title-slide hgroup h1 {
font-size: 65px;
line-height: 1.4;
letter-spacing: -3px;
color: #515151;
}

.title-slide hgroup h2 {
font-size: 34px;
color: darkgrey;
font-weight: inherit;
}

.title-slide hgroup p {
font-size: 20px;
color: #797979;
line-height: 1.3;
margin-top: 2em;
}

.quote {
color: #e6e6e6;
}

.quote .author {
font-size: 24px;
position: absolute;
bottom: 80px;
line-height: 1.4;
}

[data-config-contact] a {
color: white;
border-bottom: none;
}

[data-config-contact] span {
width: 115px;
display: inline-block;
}

.overview.popup .note {
display: none !important;
}

.overview slides slide {
display: block;
cursor: pointer;
opacity: 0.5;
pointer-events: auto !important;
background: -webkit-gradient(linear, 50% 0%, 50% 100%, color-stop(0%, #ffffff), color-stop(85%, #ffffff), color-stop(100%, #e6e6e6));
background: -webkit-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: -moz-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: -o-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background-color: white;
}

.overview slides slide.backdrop {
display: none !important;
}

.overview slides slide.far-past, .overview slides slide.past, .overview slides slide.next, .overview slides slide.far-next, .overview slides slide.far-past {
opacity: 0.5;
display: block;
}

.overview slides slide.current {
opacity: 1;
}

.overview .slide-area {
display: none;
}
slides > slide {
background: linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background-color: white;
}
slides > slide {
opacity: 0;
}
@media print {

slides slide {
display: block !important;
position: relative;
background: -webkit-gradient(linear, 50% 0%, 50% 100%, color-stop(0%, #ffffff), color-stop(85%, #ffffff), color-stop(100%, #e6e6e6));
background: -webkit-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: -moz-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: -o-linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background: linear-gradient(#ffffff, #ffffff 85%, #e6e6e6);
background-color: white;
-webkit-transform: none !important;
-moz-transform: none !important;
-ms-transform: none !important;
-o-transform: none !important;
transform: none !important;
width: 100%;
height: 100%;
page-break-after: always;
top: auto !important;
left: auto !important;
margin-top: 0 !important;
margin-left: 0 !important;
opacity: 1 !important;
color: #555;
}

slides slide.far-past, slides slide.past, slides slide.next, slides slide.far-next, slides slide.far-past, slides slide.current {
opacity: 1 !important;
display: block !important;
}

slides slide .build > * {
-webkit-transition: none;
-moz-transition: none;
-o-transition: none;
transition: none;
}

slides slide .build .to-build,
slides slide .build .build-fade {
opacity: 1;
}

slides slide .auto-fadein {
opacity: 1 !important;
}

slides slide.backdrop {
display: none !important;
}

slides slide table.rows {
border-right: 0;
}

slides slide[hidden] {
display: none !important;
}

.slide-area {
display: none;
}

.reflect {
-webkit-box-reflect: none;
-moz-box-reflect: none;
-o-box-reflect: none;
-ms-box-reflect: none;
box-reflect: none;
}

pre, code {
font-family: monospace !important;
}
}

label {
display: block;
margin-bottom: 4px;
}
label, input {
font-size: 16px;
color: #333;
}
input {
width: 220px;
}
.jslider {
margin-top: 8px;
}

.dataTables_info, .dataTables_paginate {
font-size: 14px;
}

    b, strong {
      font-weight: bold;
    }

    em {
      font-style: italic;
    }

    summary {
      display: list-item;
    }

    slides > slide {
      -webkit-transition: all 0.4s ease-in-out;
      -moz-transition: all 0.4s ease-in-out;
      -o-transition: all 0.4s ease-in-out;
      transition: all 0.4s ease-in-out;
    }

    .auto-fadein {
      -webkit-transition: opacity 0.6s ease-in;
      -webkit-transition-delay: 0.4s;
      -moz-transition: opacity 0.6s ease-in 0.4s;
      -o-transition: opacity 0.6s ease-in 0.4s;
      transition: opacity 0.6s ease-in 0.4s;
      opacity: 0;
    }
